==Trivia==
[[File:Seed vault seeds.png|thumb|right|The assortment of seeds visible in the seed vault.]]
*The name is a reference to the {{WP|Svalbard Global Seed Vault}}, which serves a similar function.
*The vault displays various seeds, including [[onion seed]]s, [[marigold seed]]s, [[cabbage seed]]s, [[acorn]]s and [[Kronos seed]]s. In addition, despite being unable to be stored, [[Grand seed pod]]s and [[Ent's roots]] can be seen inside the vault.

